import React, { useState, useMemo, useEffect } from 'react';

// Icons
const PlusIcon = ({ className = "w-4 h-4" }) => <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><line x1="12" y1="5" x2="12" y2="19"></line><line x1="5" y1="12" x2="19" y2="12"></line></svg>;

const AddTestModal = ({ isOpen, onClose, onSave, test }) => {
    const [date, setDate] = useState(new Date().toISOString().split('T')[0]);
    const [multiplier, setMultiplier] = useState(test?.recommendation || 1);
    const [phase, setPhase] = useState('Probatorik / Schluss');

    useEffect(() => {
        if(test) {
            setMultiplier(test.recommendation || 1);
            setDate(new Date().toISOString().split('T')[0]);
            setPhase('Probatorik / Schluss');
        }
    }, [test]);

    if (!isOpen || !test) return null;

    const handleSave = () => {
        onSave({ testId: test.id, date, multiplier: parseInt(multiplier, 10), phase });
        onClose();
    };

    return (
        // Wiederverwendung der Modal-Logik, die in App.js schon existiert
        <div className="fixed inset-0 bg-black bg-opacity-60 backdrop-blur-sm flex justify-center items-center z-50 p-4">
            <div className="bg-white p-6 rounded-lg shadow-xl w-full max-w-lg">
                <h3 className="text-lg font-semibold mb-4">Test hinzufügen: {test.name}</h3>
                <div className="space-y-4">
                    <div>
                        <label className="block text-sm font-medium text-gray-700">Testdatum</label>
                        <input type="date" value={date} onChange={e => setDate(e.target.value)} className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm"/>
                    </div>
                     <div>
                        <label className="block text-sm font-medium text-gray-700">Multiplikator (x 5 Minuten)</label>
                        <div className="flex items-center">
                            <input type="number" value={multiplier} onChange={e => setMultiplier(e.target.value)} min="1" className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm"/>
                            <span className="ml-3 text-sm text-gray-500 whitespace-nowrap">x vollendete fünf Minuten</span>
                        </div>
                    </div>
                     <div>
                        <label className="block text-sm font-medium text-gray-700">Testung während:</label>
                        <div className="mt-2 flex space-x-4">
                             <label><input type="radio" name="phase" value="Probatorik / Schluss" checked={phase === 'Probatorik / Schluss'} onChange={e => setPhase(e.target.value)} /> Probatorik / Schluss</label>
                             <label><input type="radio" name="phase" value="Kurzzeittherapie" checked={phase === 'Kurzzeittherapie'} onChange={e => setPhase(e.target.value)} /> Kurzzeittherapie</label>
                             <label><input type="radio" name="phase" value="Langzeittherapie" checked={phase === 'Langzeittherapie'} onChange={e => setPhase(e.target.value)} /> Langzeittherapie</label>
                        </div>
                    </div>
                </div>
                <div className="flex justify-end space-x-3 mt-6">
                    <button onClick={onClose} className="px-4 py-2 text-sm text-gray-700 bg-gray-200 rounded-md">Abbrechen</button>
                    <button onClick={handleSave} className="px-4 py-2 text-sm text-white bg-green-600 rounded-md hover:bg-green-700">Speichern & Abrechnen</button>
                </div>
            </div>
        </div>
    );
};


const DiagnostikUebersicht = ({ patient, availableTests, onAddTest, onShowTestDetails }) => {
    const [testSearchQuery, setTestSearchQuery] = useState('');


    const conductedTests = useMemo(() => {
        const tests = [];
        if (patient.scl90rResults?.length > 0) tests.push({ name: 'SCL-90-R', count: patient.scl90rResults.length, id: 'scl90r' });
        if (patient.fep2Results?.length > 0) tests.push({ name: 'FEP-2', count: patient.fep2Results.length, id: 'fep2' });
        if (patient.bdi2Results?.length > 0) tests.push({ name: 'BDI-II', count: patient.bdi2Results.length, id: 'bdi2' });
        if (patient.hscl11Results?.length > 0) tests.push({ name: 'HSCL-11', count: patient.hscl11Results.length, id: 'hscl11' });
        return tests;
    }, [patient]);

    const filteredAvailableTests = availableTests.filter(test => 
        test.name.toLowerCase().includes(testSearchQuery.toLowerCase())
    );

const handleOpenAddModal = (test) => {
    onAddTest(test);
};


    return (
        <div>
            <AddTestModal 
                isOpen={isAddTestModalOpen}
                onClose={() => setIsAddTestModalOpen(false)}
                onSave={onAddTest}
                test={currentTestToAdd}
            />

            <div className="mb-6">
                <h4 className="text-lg font-semibold text-gray-700 mb-2">Neuen Test hinzufügen</h4>
                <div className="relative">
                    <input 
                        type="text"
                        placeholder="Test suchen (z.B. BDI)"
                        value={testSearchQuery}
                        onChange={(e) => setTestSearchQuery(e.target.value)}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm"
                    />
                    {testSearchQuery && (
                         <ul className="absolute z-10 w-full bg-white border border-gray-300 rounded-md mt-1 shadow-lg max-h-60 overflow-y-auto">
                           {filteredAvailableTests.map(test => (
                               <li 
                                key={test.id} 
                                onClick={() => handleOpenAddModal(test)}
                                className="px-3 py-2 cursor-pointer hover:bg-indigo-50 flex justify-between items-center"
                               >
                                   <span>{test.name}</span>
                                   <button className="text-xs bg-indigo-500 text-white rounded-full p-1 leading-none"><PlusIcon /></button>
                               </li>
                           ))}
                        </ul>
                    )}
                </div>
            </div>

            <div>
                <h4 className="text-lg font-semibold text-gray-700 mb-2">Durchgeführte Testdiagnostik</h4>
                {conductedTests.length > 0 ? (
                    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
                        {conductedTests.map(test => (
                            <div key={test.id} className="bg-gray-50 p-3 rounded-lg border border-gray-200">
                                <p className="font-semibold text-gray-800">{test.name}</p>
                                <p className="text-sm text-gray-500">{test.count} Durchführung(en)</p>
                                <button onClick={() => onShowTestDetails(test.id)} className="text-sm text-indigo-600 hover:underline mt-2">Details anzeigen</button>
                            </div>
                        ))}
                    </div>
                ) : (
                    <p className="text-sm text-gray-500">Für diesen Patienten wurde noch keine Diagnostik erfasst.</p>
                )}
            </div>
        </div>
    );
};

export default DiagnostikUebersicht;
